import React from 'react';

import './Product.css';


const Product = ({name, img,description,count}) => {

    console.log(name, img,description,count)
    return(
        <div className='product'>
            <div className='product__img'>
                <img src={img} alt='Product'/>
            </div>
            <div className='product__text'>
                <h3 className='product__text-title'>{name}</h3>
                <p className="product__text-description">
                    Description: <span className='descriptio-text'>
                    {
                        description
                    }
                </span>
                </p>
                <p className='product__text-quantity'>
                    Quantity:{count}
                </p>
                <button className='product__btn' type='btn'>Details</button>
            </div>
        </div>
    )
}

export default Product;
